Generalizing the definition of pairs, we can describe the type of number lists as follows: "A list is either the empty list or a set of one element and another list", this type is not composed of a head and a tail. type List (t) { nil cons (head: t) (tail: List t)
} As we are dealing with only one type, it is interesting to rewrite the list type for a defined one, the chosen one was Nat: type NatList { nil cons (head: Nat) (tail: NatList)
} or type NatList { List Nat
} We can see that in both notations, there is a head and a tail, with the head receiving an element of type Nat and the tail receiving a list of type Nat. For example, a list of three natural numbers 1n, 2n, and 3n would be written as follows: [1n, 2n, 3n] However, the Kind reads it differently: [1n, [2n, 3n]] where 1n is the head and [2n, 3n] is the tail. Likewise, looking at a list of 4 elements [1n, 2n, 3n, 4n], we now see it as follows: [1n, [2n, [3n, 4n]]] The list has the head 1n and the tail [2n, [3n, 4n]], which, in turn, has the head 2n and the tail [3n, 4n] which also has its head 3n and its tail 4n. It may seem scary, but it's a friendly monster: img [fonte da imagem: http://learnyouahaskell.com/starting-out]
